AnalyticsAnalytics is a way for you to track how users interact with your web app.ConfigurationInitialize the availity.config module in your application.angular.module('app', ['availity.config']);
Virtual Page TrackingVirtual page tracking is enabled by default. Virtual page tracking logs the value of $location.absUrl() on every route change to the analytics server.Virtual page can be disabled using avAnalyticsConfigProvider (not recommened)_app.config( ($scope, avAnalyticsConfigProvider) => {
    avAnalyticsConfigProvider.setVirtualPageTracking(false);
});
Anatomy of an EventThe following descriptions were copied from http://www.statstory.com/category - This is the name you want to give for the collection where actions you want to track will occur. An example of category could be Videoâ€™s or Datasheets.  Categories are useful for grouping events in analytics reports.

label - This is an optional string which can be valuable in adding a dimension to the event data. Usually I use it to differentiate content. For example, if you want to know which specific video is played or which datasheet is downloaded.

action - This is a string which is paired with each category, and most often is used to describe the user interaction with your content. An example could be play, click or download.

value - This is a number, which you can use to provide a numerical dimension to a user action. Normally, I leave this blank unless I have an e-commerce reason. For example if you have a form, where a user can fill in a price or quantity, you can pass this value via an event.

Event TrackingTo add event tracking to an element on the page you will need to use the av-analytics-on directive. When applying analytics  you should include the av-analytics-on directive on the element you want to track, this will pull the inner text of the element and set it as a label. Optionally if no inner text exists, include the av-analytics-label attribute on the element . There are also two optional attributes av-analytics-value, av-analytics-category that you can append to an element for more detailed events.av-analytics - (required) Used to set defaults for all child av-analytics-on directives.  See example below.

