AuthorizationsavUserAuthorizations is a service that allows you to get user and 
permission information.ConfigurationInitialize the availity module in your application.angular.module('app', ['availity']);
Usageangular.module('app', ['availity'])
    .factory('authenticationService', avUserAuthorizations => {

        class AuthenticationService {

            constructor() {                
                avUserAuthorized.isAuthorized('7100').then(isAuthorized => {
                    this.isAuthorized = isAuthorized;
                });
            }
        }

        return new AuthenticationService();

    });
MethodsavUserAuthorizations contains the following methods.isAuthorizedReturns true if the current user is authorized for the specified permission.avUserAuthorizations.isAuthorized(permissionId);
isAnyAuthorizedReturns true if the current user is authorized for at least one of the specified permissions.avUserAuthorizations.isAnyAuthorized([permissionId1, permissionId2]);
getPermissionReturns the permission having the specified permissionId.avUserAuthorizations.getPermission(permissionId);
getPermissionsReturns the permissions having the specified permissionIds.avUserAuthorizations.getPermissions([permissionId1, permissionId2]);
getOrganizationsReturns the user's organizations that have access to the specified permissionId.avUserAuthorizations.getOrganizations(permissionId);
getPayersReturns the payers the user has access to for the specified permissionId and organizationId.avUserAuthorization.getPayers(permissionId, organizationId);

