DimmeravDimmer is a directive that displays a message or effect over an element. avDimmer checks for a specific child element and if its found, will call a velocity animation on it based on a show and hide event.Usageangular.module('app', ['availity.ui']);
ConfigurationavDimmerConfigProvider can be used to globally set values for all avDimmer instances.  Directive overrides are allow passing the configuration to attribute av-dimmer-config.
  {
    animationConfig: {
      duration: 250
    },
    showAnimation: 'fadeIn',
    showEvent: 'mouseenter',
    hideAnimation: 'fadeOut',
    hideEvent: 'mouseleave',
    overlaySelector: '.dimmer-content'
  }
DirectiveThe directive av-dimmer can be used as an element or an attribute     ...
